// Exercice1.js
import React from 'react';
import BoutonClique from './BoutonClique';
import BoutonBascule from './BoutonBascule';
import AppSuivi from './AppSuivi';
import Compteur from './Compteur';

const Exercise1 = () => {
  return (
    <div>
      <h2>Exercise 1</h2>
      <div>
        <h3>Click Button</h3>
        <BoutonClique />
      </div>
      <div>
        <h3>Toggle Button</h3>
        <ToggleButton />
      </div>
      <div>
        <h3>Click Tracker</h3>
        <ClickTracker />
      </div>
      <div>
        <h3>Counter</h3>
        <Counter />
      </div>
    </div>
  );
};

export default Exercise1;
